import { v4 as uuidv4 } from 'uuid';
import * as types from '../types/events'

export const add_event = (userid,eventType,datetime,info) => ({
    type: types.event_added,
    payload:{
        id: userid,
        element: {
            id: uuidv4(),
            eventType,
            datetime,
            info
        }
    }
})

export const delete_event = (user,id) => ({
    type: types.event_deleted,
    payload: {
        user,
        id,
    }
})
